import React from 'react'
import './statusboard.scss'
import {createBrowserRouter} from "react-router-dom";


function StatusBoard(props) {
    return (
        <div className="status-board">
            <div className="status-board-tools">
                <div className="title">{props.title}</div>
                <div className="tools">
                    {
                        props.dataOfTools.map((img_link,index) => (
                            <div key={index} className="tool">
                                <img src={`/img/${img_link}`} alt="lol"/>
                            </div>
                        )
                )}
                </div>
            </div>
            <div className="table">
                <div className="table-columns">
                    {props.titles.map(({title},index) => (
                        <div key = {index} className="col-title">{title}</div>
                    ))}
                </div>
                <div className="table-rows">
                    {/*<div className="checkbox-images-wrapper">*/}
                    {/*{props.data.map(({ellipse, img_link}, index) => (*/}
                    {/*        <div key = {index} className="checkbox-images">*/}
                    {/*            <div className="checkbox">*/}
                    {/*                <input type="checkbox"/>*/}
                    {/*            </div>*/}
                    {/*            <div className="border-box">*/}
                    {/*                <img className="ellipse" src={ellipse} alt=""/>*/}
                    {/*                <img className="picture" src={img_link} alt=""/>*/}
                    {/*            </div>*/}
                    {/*        </div>*/}
                    {/*))}*/}
                    {/*</div>*/}
                    {/*<div className="block-information-wrapper">*/}
                    {/*    {props.data.map(({company, position, duration, job_id, status}, index) => (*/}
                    {/*        <div key = {index} className="block-information">*/}
                    {/*            <div className="information">{company}</div>*/}
                    {/*            <div className="information">{position}</div>*/}
                    {/*            <div className="information">{duration}</div>*/}
                    {/*            <div className="information">{job_id}</div>*/}
                    {/*            <div className="information">{status}</div>*/}
                    {/*        </div>*/}
                    {/*    ))}*/}
                    {/*</div>*/}
                    {/*<div className="dot-vertical-wrapper">*/}
                    {/*    {props.data.map(({points}, index) => (*/}
                    {/*        <div key = {index} className="dot-vertical">*/}
                    {/*            <img src={points} alt=""/>*/}
                    {/*        </div>*/}
                    {/*    ))}*/}
                    {/*</div>*/}
                    {props.data.map(({}) => (
                        <div className="rows-container">
                            <div className="checkbox">1</div>
                            <div className="border-box">
                                <div className="img">
                                    <div className="ellipse"></div>
                                </div>
                            </div>
                            <div>3</div>
                            <div>4</div>
                            <div>5</div>
                            <div>6</div>
                            <div>7</div>
                        </div>
                        ))}
                </div>
            </div>
        </div>
    );
}
export default StatusBoard;
